  false,\n\t\"url\": null,\n\t\"notes\": \"The City of Seattle implements biennial
  budgeting through the sequential adoptionnof two one-year budgets. When adopting
  the budget for the first year of the biennium, the Council endorses a budget for
  the second year. nnThe Endorsed Budget is the basis for a Proposed Budget for the
  second year of the biennium, and is reviewed and adopted in the fall of the first
  year of the biennium.nnThis data reflects all appropriations (by budget control
  level) included in the 2014 Endorsed Budget.\",\n\t\"owner_org\": \"5107fb38-f013-41bc-b6d9-80e63c333796\",\n\t\"extras\":
